import React from 'react';
import utsLogo from '../svg/uts-logo.svg';

class Header extends React.Component{
    render(){
        return(
            <header className="header">
                <div className="header__logo">
                <utsLogo />
                </div>
            </header>
        );
    }
}

export default Header;
